import React, { useState } from 'react';
import {
  Box, Typography, TextField, Grid, Paper, Button, Table, TableBody, TableCell, TableContainer,
  TableHead, TableRow, InputAdornment
} from '@mui/material';
import { useNavigate } from 'react-router-dom';

const ApplicationFormBPT = () => {
  const navigate = useNavigate();

  const [formData, setFormData] = useState({
    // Existing personal details
    adNo: '',
    adDate: '',
    applicationNo: '',
    courseName: '',
    courseCode: '',
    dateOfEntry: '',
    lastDate: '',
    department: '',
    name: '',
    fatherName: '',
    dob: '',
    age: '',
    birthPlace: '',
    status: '',
    nationality: '',
    maritalStatus: '',
    gender: '',
    differentlyAbled: '',
    idMark1: '',
    idMark2: '',
    universityArea: '',
    inService: '',
    aadhar: '',
    fatherEmail: '',
    fatherAge: '',
    fatherOccupation: '',
    motherName: '',
    motherAge: '',
    motherOccupation: '',
    monthlyIncome: '',

    // Educational details from BPT-2.pdf
    intermediateSubjects: [
      { name: '', theory1stYear: '59', theory1stMax: '60', theory2ndYear: '51', theory2ndMax: '60', practical: '30', practicalMax: '30', total: '140', totalMax: '150' },
      { name: 'Zoology', theory1stYear: '57', theory1stMax: '60', theory2ndYear: '54', theory2ndMax: '60', practical: '30', practicalMax: '30', total: '141', totalMax: '150' },
      { name: 'Physics', theory1stYear: '60', theory1stMax: '60', theory2ndYear: '47', theory2ndMax: '60', practical: '30', practicalMax: '30', total: '137', totalMax: '150' },
      { name: 'Chemistry', theory1stYear: '60', theory1stMax: '60', theory2ndYear: '40', theory2ndMax: '60', practical: '30', practicalMax: '30', total: '130', totalMax: '150' },
      { name: 'English', theory1stYear: '92', theory1stMax: '100', theory2ndYear: '92', theory2ndMax: '100', practical: '', practicalMax: '', total: '184', totalMax: '200' },
      { name: 'Second language', theory1stYear: '98', theory1stMax: '100', theory2ndYear: '98', theory2ndMax: '100', practical: '', practicalMax: '', total: '196', totalMax: '200' }
    ],
    intermediateTotals: {
      overallObtained: '928',
      overallMax: '1000',
      overallPercentage: '92.8',
      groupObtained: '548',
      groupMax: '600',
      groupPercentage: '91.33'
    },
    academicHistory: [
      { class: 'Inter 2nd Year', year: '2023', institution: 'SR JUNIOR COLLEGE', place: 'PEDDAMBERPET', state: 'Telangana', district: 'Rangareddy' },
      { class: 'Inter 1st Year', year: '2022', institution: 'SR JUNIOR COLLEGE', place: 'PEDDAMBERPET', state: 'Telangana', district: 'Rangareddy' },
      { class: '10th Class', year: '2021', institution: 'FORTUNE BUTTERFLY SCHOOL AMANGAL', place: 'KADTHAL', state: 'Telangana', district: 'Rangareddy' },
      { class: '9th Class', year: '2020', institution: 'FORTUNE BUTTERFLY SCHOOL AMANGAL', place: 'KADTHAL', state: 'Telangana', district: 'Rangareddy' },
      { class: '8th Class', year: '2019', institution: 'FORTUNE BUTTERFLY SCHOOL AMANGAL', place: 'KADTHAL', state: 'Telangana', district: 'Rangareddy' },
      { class: '7th Class', year: '2018', institution: 'FORTUNE BUTTERFLY SCHOOL AMANGAL', place: 'KADTHAL', state: 'Telangana', district: 'Rangareddy' },
      { class: '6th Class', year: '2017', institution: 'FORTUNE BUTTERFLY SCHOOL AMANGAL', place: 'KADTHAL', state: 'Telangana', district: 'Rangareddy' }
    ],
    eapcetDetails: {
      registrationNumber: 'A151427674D7',
      hallTicketNumber: '2513C03232',
      rank: '14660'
    }
  });

  const handleChange = (field) => (event) => {
    setFormData(prev => ({ ...prev, [field]: event.target.value }));
  };

  const handleSubjectChange = (index, field) => (event) => {
    const updatedSubjects = [...formData.intermediateSubjects];
    updatedSubjects[index][field] = event.target.value;
    setFormData(prev => ({ ...prev, intermediateSubjects: updatedSubjects }));
  };

  const handleTotalChange = (field) => (event) => {
    setFormData(prev => ({
      ...prev,
      intermediateTotals: {
        ...prev.intermediateTotals,
        [field]: event.target.value
      }
    }));
  };

  const handleAcademicHistoryChange = (index, field) => (event) => {
    const updatedHistory = [...formData.academicHistory];
    updatedHistory[index][field] = event.target.value;
    setFormData(prev => ({ ...prev, academicHistory: updatedHistory }));
  };

  const handleEapcetChange = (field) => (event) => {
    setFormData(prev => ({
      ...prev,
      eapcetDetails: {
        ...prev.eapcetDetails,
        [field]: event.target.value
      }
    }));
  };

  const handleSubmit = () => {
    navigate('/report', { state: formData });
  };

  return (
    <Box sx={{ pt: 4, px: 6, pb: 7 }}>
      <Typography variant="h5" gutterBottom align="center">
        APPLICATION FORM - Bachelor of Physiotherapy - 2025
      </Typography>

      <Grid container spacing={3}>
        {/* Advertisement Details */}
        <Grid item xs={12}>
          <Paper elevation={2} sx={{ p: 2 }}>
            <Typography variant="subtitle1" fontWeight="bold">Advertisement Details</Typography>
            <Grid container spacing={2}>
              <Grid item xs={6}><TextField label="Ad. No." fullWidth value={formData.adNo} onChange={handleChange('adNo')} /></Grid>
              <Grid item xs={6}><TextField label="Ad. Date" fullWidth value={formData.adDate} onChange={handleChange('adDate')} /></Grid>
              <Grid item xs={6}><TextField label="Application No." fullWidth value={formData.applicationNo} onChange={handleChange('applicationNo')} /></Grid>
              <Grid item xs={6}><TextField label="Course Name" fullWidth value={formData.courseName} onChange={handleChange('courseName')} /></Grid>
              <Grid item xs={6}><TextField label="Course Code" fullWidth value={formData.courseCode} onChange={handleChange('courseCode')} /></Grid>
              <Grid item xs={6}><TextField label="Date of Entry" fullWidth value={formData.dateOfEntry} onChange={handleChange('dateOfEntry')} /></Grid>
              <Grid item xs={6}><TextField label="Last Date of Application" fullWidth value={formData.lastDate} onChange={handleChange('lastDate')} /></Grid>
              <Grid item xs={6}><TextField label="Department" fullWidth value={formData.department} onChange={handleChange('department')} /></Grid>
            </Grid>
          </Paper>
        </Grid>

        {/* Applicant's Details */}
        <Grid item xs={12}>
          <Paper elevation={2} sx={{ p: 2 }}>
            <Typography variant="subtitle1" fontWeight="bold">Applicant's Details</Typography>
            <Grid container spacing={2}>
              <Grid item xs={6}><TextField label="Name" fullWidth value={formData.name} onChange={handleChange('name')} /></Grid>
              <Grid item xs={6}><TextField label="Father's Name" fullWidth value={formData.fatherName} onChange={handleChange('fatherName')} /></Grid>
              <Grid item xs={6}><TextField label="Date of Birth" fullWidth value={formData.dob} onChange={handleChange('dob')} /></Grid>
              <Grid item xs={6}><TextField label="Age (on last date)" fullWidth value={formData.age} onChange={handleChange('age')} /></Grid>
              <Grid item xs={6}><TextField label="Place of Birth" fullWidth value={formData.birthPlace} onChange={handleChange('birthPlace')} /></Grid>
              <Grid item xs={6}><TextField label="Social Status" fullWidth value={formData.status} onChange={handleChange('status')} /></Grid>
              <Grid item xs={6}><TextField label="Nationality" fullWidth value={formData.nationality} onChange={handleChange('nationality')} /></Grid>
              <Grid item xs={6}><TextField label="Marital Status" fullWidth value={formData.maritalStatus} onChange={handleChange('maritalStatus')} /></Grid>
              <Grid item xs={6}><TextField label="Gender" fullWidth value={formData.gender} onChange={handleChange('gender')} /></Grid>
              <Grid item xs={6}><TextField label="Differently Abled" fullWidth value={formData.differentlyAbled} onChange={handleChange('differentlyAbled')} /></Grid>
              <Grid item xs={6}><TextField label="Identification Mark 1" fullWidth value={formData.idMark1} onChange={handleChange('idMark1')} /></Grid>
              <Grid item xs={6}><TextField label="Identification Mark 2" fullWidth value={formData.idMark2} onChange={handleChange('idMark2')} /></Grid>
              <Grid item xs={6}><TextField label="University Area" fullWidth value={formData.universityArea} onChange={handleChange('universityArea')} /></Grid>
              <Grid item xs={6}><TextField label="In-service (Govt.)" fullWidth value={formData.inService} onChange={handleChange('inService')} /></Grid>
              <Grid item xs={6}><TextField label="Aadhar" fullWidth value={formData.aadhar} onChange={handleChange('aadhar')} /></Grid>
              <Grid item xs={6}><TextField label="Father's Email" fullWidth value={formData.fatherEmail} onChange={handleChange('fatherEmail')} /></Grid>
            </Grid>
          </Paper>
        </Grid>

        {/* Parent/Spouse Details */}
        <Grid item xs={12}>
          <Paper elevation={2} sx={{ p: 2 }}>
            <Typography variant="subtitle1" fontWeight="bold">Parents' Details</Typography>
            <Grid container spacing={2}>
              <Grid item xs={4}><TextField label="Father's Name" fullWidth value={formData.fatherName} onChange={handleChange('fatherName')} /></Grid>
              <Grid item xs={4}><TextField label="Age" fullWidth value={formData.fatherAge} onChange={handleChange('fatherAge')} /></Grid>
              <Grid item xs={4}><TextField label="Occupation" fullWidth value={formData.fatherOccupation} onChange={handleChange('fatherOccupation')} /></Grid>
              <Grid item xs={4}><TextField label="Mother's Name" fullWidth value={formData.motherName} onChange={handleChange('motherName')} /></Grid>
              <Grid item xs={4}><TextField label="Age" fullWidth value={formData.motherAge} onChange={handleChange('motherAge')} /></Grid>
              <Grid item xs={4}><TextField label="Occupation" fullWidth value={formData.motherOccupation} onChange={handleChange('motherOccupation')} /></Grid>
              <Grid item xs={4}><TextField label="Monthly Income" fullWidth value={formData.monthlyIncome} onChange={handleChange('monthlyIncome')} /></Grid>
            </Grid>
          </Paper>
        </Grid>

        {/* Intermediate Marks */}
        <Grid item xs={12}>
          <Paper elevation={2} sx={{ p: 2 }}>
            <Typography variant="subtitle1" fontWeight="bold">Intermediate Marks Details</Typography>
            <TableContainer>
              <Table size="small">
                <TableHead>
                  <TableRow>
                    <TableCell>Subject</TableCell>
                    <TableCell>1st Year Theory</TableCell>
                    <TableCell>2nd Year Theory</TableCell>
                    <TableCell>Practicals</TableCell>
                    <TableCell>Total</TableCell>
                  </TableRow>
                </TableHead>
                <TableBody>
                  {formData.intermediateSubjects.map((subject, index) => (
                    <TableRow key={index}>
                      <TableCell>
                        <TextField 
                          value={subject.name} 
                          onChange={handleSubjectChange(index, 'name')}
                          size="small"
                          fullWidth
                        />
                      </TableCell>
                      <TableCell>
                        <Grid container spacing={1}>
                          <Grid item xs={6}>
                            <TextField
                              value={subject.theory1stYear}
                              onChange={handleSubjectChange(index, 'theory1stYear')}
                              size="small"
                              InputProps={{
                                endAdornment: <InputAdornment position="end">/</InputAdornment>,
                              }}
                            />
                          </Grid>
                          <Grid item xs={6}>
                            <TextField
                              value={subject.theory1stMax}
                              onChange={handleSubjectChange(index, 'theory1stMax')}
                              size="small"
                            />
                          </Grid>
                        </Grid>
                      </TableCell>
                      <TableCell>
                        <Grid container spacing={1}>
                          <Grid item xs={6}>
                            <TextField
                              value={subject.theory2ndYear}
                              onChange={handleSubjectChange(index, 'theory2ndYear')}
                              size="small"
                              InputProps={{
                                endAdornment: <InputAdornment position="end">/</InputAdornment>,
                              }}
                            />
                          </Grid>
                          <Grid item xs={6}>
                            <TextField
                              value={subject.theory2ndMax}
                              onChange={handleSubjectChange(index, 'theory2ndMax')}
                              size="small"
                            />
                          </Grid>
                        </Grid>
                      </TableCell>
                      <TableCell>
                        <Grid container spacing={1}>
                          <Grid item xs={6}>
                            <TextField
                              value={subject.practical}
                              onChange={handleSubjectChange(index, 'practical')}
                              size="small"
                              InputProps={{
                                endAdornment: <InputAdornment position="end">/</InputAdornment>,
                              }}
                            />
                          </Grid>
                          <Grid item xs={6}>
                            <TextField
                              value={subject.practicalMax}
                              onChange={handleSubjectChange(index, 'practicalMax')}
                              size="small"
                            />
                          </Grid>
                        </Grid>
                      </TableCell>
                      <TableCell>
                        <Grid container spacing={1}>
                          <Grid item xs={6}>
                            <TextField
                              value={subject.total}
                              onChange={handleSubjectChange(index, 'total')}
                              size="small"
                              InputProps={{
                                endAdornment: <InputAdornment position="end">/</InputAdornment>,
                              }}
                            />
                          </Grid>
                          <Grid item xs={6}>
                            <TextField
                              value={subject.totalMax}
                              onChange={handleSubjectChange(index, 'totalMax')}
                              size="small"
                            />
                          </Grid>
                        </Grid>
                      </TableCell>
                    </TableRow>
                  ))}
                </TableBody>
              </Table>
            </TableContainer>

            <Grid container spacing={2} sx={{ mt: 2 }}>
              <Grid item xs={4}>
                <TextField
                  label="Total Marks Obtained"
                  value={formData.intermediateTotals.overallObtained}
                  onChange={handleTotalChange('overallObtained')}
                  fullWidth
                  InputProps={{
                    endAdornment: <InputAdornment position="end">/ {formData.intermediateTotals.overallMax}</InputAdornment>,
                  }}
                />
              </Grid>
              <Grid item xs={2}>
                <TextField
                  label="Percentage"
                  value={formData.intermediateTotals.overallPercentage}
                  onChange={handleTotalChange('overallPercentage')}
                  fullWidth
                  InputProps={{
                    endAdornment: <InputAdornment position="end">%</InputAdornment>,
                  }}
                />
              </Grid>
              <Grid item xs={4}>
                <TextField
                  label="Group Marks Obtained"
                  value={formData.intermediateTotals.groupObtained}
                  onChange={handleTotalChange('groupObtained')}
                  fullWidth
                  InputProps={{
                    endAdornment: <InputAdornment position="end">/ {formData.intermediateTotals.groupMax}</InputAdornment>,
                  }}
                />
              </Grid>
              <Grid item xs={2}>
                <TextField
                  label="Group Percentage"
                  value={formData.intermediateTotals.groupPercentage}
                  onChange={handleTotalChange('groupPercentage')}
                  fullWidth
                  InputProps={{
                    endAdornment: <InputAdornment position="end">%</InputAdornment>,
                  }}
                />
              </Grid>
            </Grid>
          </Paper>
        </Grid>

        {/* Academic History */}
        <Grid item xs={12}>
          <Paper elevation={2} sx={{ p: 2 }}>
            <Typography variant="subtitle1" fontWeight="bold">Academic History</Typography>
            <TableContainer>
              <Table size="small">
                <TableHead>
                  <TableRow>
                    <TableCell>Class</TableCell>
                    <TableCell>Year</TableCell>
                    <TableCell>Institution</TableCell>
                    <TableCell>Place</TableCell>
                    <TableCell>State</TableCell>
                    <TableCell>District</TableCell>
                  </TableRow>
                </TableHead>
                <TableBody>
                  {formData.academicHistory.map((record, index) => (
                    <TableRow key={index}>
                      <TableCell>
                        <TextField 
                          value={record.class} 
                          onChange={handleAcademicHistoryChange(index, 'class')}
                          size="small"
                          fullWidth
                        />
                      </TableCell>
                      <TableCell>
                        <TextField 
                          value={record.year} 
                          onChange={handleAcademicHistoryChange(index, 'year')}
                          size="small"
                          fullWidth
                        />
                      </TableCell>
                      <TableCell>
                        <TextField 
                          value={record.institution} 
                          onChange={handleAcademicHistoryChange(index, 'institution')}
                          size="small"
                          fullWidth
                        />
                      </TableCell>
                      <TableCell>
                        <TextField 
                          value={record.place} 
                          onChange={handleAcademicHistoryChange(index, 'place')}
                          size="small"
                          fullWidth
                        />
                      </TableCell>
                      <TableCell>
                        <TextField 
                          value={record.state} 
                          onChange={handleAcademicHistoryChange(index, 'state')}
                          size="small"
                          fullWidth
                        />
                      </TableCell>
                      <TableCell>
                        <TextField 
                          value={record.district} 
                          onChange={handleAcademicHistoryChange(index, 'district')}
                          size="small"
                          fullWidth
                        />
                      </TableCell>
                    </TableRow>
                  ))}
                </TableBody>
              </Table>
            </TableContainer>
          </Paper>
        </Grid>

        {/* EAPCET Details */}
        <Grid item xs={12}>
          <Paper elevation={2} sx={{ p: 2 }}>
            <Typography variant="subtitle1" fontWeight="bold">TG EAPCET Details</Typography>
            <Grid container spacing={2}>
              <Grid item xs={4}>
                <TextField
                  label="Registration Number"
                  value={formData.eapcetDetails.registrationNumber}
                  onChange={handleEapcetChange('registrationNumber')}
                  fullWidth
                />
              </Grid>
              <Grid item xs={4}>
                <TextField
                  label="Hall Ticket Number"
                  value={formData.eapcetDetails.hallTicketNumber}
                  onChange={handleEapcetChange('hallTicketNumber')}
                  fullWidth
                />
              </Grid>
              <Grid item xs={4}>
                <TextField
                  label="Rank"
                  value={formData.eapcetDetails.rank}
                  onChange={handleEapcetChange('rank')}
                  fullWidth
                />
              </Grid>
            </Grid>
          </Paper>
        </Grid>

        {/* Submit Button */}
        <Grid item xs={12} textAlign="center">
          <Button variant="contained" color="primary" onClick={handleSubmit} size="large">
            Submit
          </Button>
        </Grid>
      </Grid>
    </Box>
  );
};

export default ApplicationFormBPT;
